import { Link } from "react-router-dom";
import './Photography.css'

function Photography(){
    return(<div>
       <h3>2022</h3>
      <h1 className="font_4hjqte5kp">
      Metaverse at Google
      </h1>



      <span data-mce-style="font-family: Karla, sans-serif;" style="font-family: Karla, sans-serif;">I worked with a number of designers and researchers on the small Immersive Studio to explore potential entrypoints for Google inside the Metaverse. I built numerous prototypes that were presented to leadership in Q4 of 2022.</span>

    
      
        
    </div>)
}

export default Photography;
